/*Table structure for table `TABLE_PERMISSIONS` */

DROP TABLE IF EXISTS `TABLE_PERMISSIONS`;

CREATE TABLE `TABLE_PERMISSIONS` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `LOGIN_ID` int(11) NOT NULL,
  `TABLE_NAME` varchar(255) NOT NULL,
  `CAN_CREATE` enum('0','1') NOT NULL DEFAULT '0',
  `CAN_VIEW` enum('0','1') NOT NULL DEFAULT '0',
  `CAN_EDIT` enum('0','1') NOT NULL DEFAULT '0',
  `CAN_DELETE` enum('0','1') NOT NULL DEFAULT '0',
  `UPDATED_ON` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `CREATED_ON` datetime DEFAULT NULL,
  `LAST_MODIFIED_ON` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`ID`)
