/*Table structure for table `TESTHEADER` */

DROP TABLE IF EXISTS `TESTHEADER`;

CREATE TABLE `TESTHEADER` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `SN` bigint(20) DEFAULT NULL,
  `PN` varchar(100) DEFAULT NULL,
  `HWS` varchar(100) DEFAULT NULL,
  `SKU` varchar(255) DEFAULT NULL,
  `PRODUCT` varchar(255) DEFAULT NULL,
  `CONSOLE` int(100) DEFAULT NULL,
  `STATIONID` varchar(100) DEFAULT NULL,
  `COMPUTER_NAME` varchar(100) DEFAULT NULL,
  `TBVERSION` varchar(100) DEFAULT NULL,
  `DIAGVERSION` varchar(100) DEFAULT NULL,
  `OSVERSION` varchar(100) DEFAULT NULL,
  `USERID` varchar(100) DEFAULT NULL,
  `OPMODE` varchar(100) DEFAULT NULL,
  `MODULE` varchar(100) DEFAULT NULL,
  `STARTTIME` datetime DEFAULT NULL,
  `ENDTIME` datetime DEFAULT NULL,
  `TOTALTESTTIME` datetime DEFAULT NULL,
  `REV` int(255) DEFAULT NULL,
  `OVERALLSTATUS` varchar(100) DEFAULT NULL,
  `TESTREPORT` varchar(255) DEFAULT NULL,
  `RUNNINGLOG` text,
  `TRACELOG` varchar(255) DEFAULT NULL,
  `TIMEZONE` varchar(255) DEFAULT NULL,
  `TTF` varchar(255) DEFAULT NULL,
  `FLAG` int(5) DEFAULT '0',
  `CREATED_ON` datetime DEFAULT NULL,
  `LAST_MODIFIED_ON` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `RCA_BY` varchar(50) DEFAULT NULL,
  `ROOT_CAUSE` varchar(255) DEFAULT NULL,
  `EXPLAINATION` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=325 DEFAULT CHARSET=latin1;

